	 ('13ab361e-bbff-4d85-8fad-cc11900db9fc','audi-a3','Audi A3','','El Audi A3 Sedan combina el car&aacute;cter de un coup&eacute; con un dise&ntilde;o elegante. La c&uacute;pula del techo bajo y fluido transmite pura din&aacute;mica. Con sus superficies musculosas y tensas, la limusina tambi&eacute;n irradia confianza en s&iacute; misma.',0,1,1,1,1,1,NULL,NULL,0.0,NULL,'2021-07-01 18:20:23.008807000','2021-07-22 19:16:02',NULL,'47edfa79-cda0-422f-b5ab-4dd442e8b62d',NULL,'773e3460-a166-4172-82d4-da9de8de560b','Totalmente encantador.',22,' La tecnología innovadora del Audi A3 Sedan también contribuye a una experiencia de conducción cómoda. Un aspecto destacado del interior es el Audi virtual cockpit opcional totalmente digital.',NULL,'INACTIVE'),
