	 ('2d015309-2bdc-43a2-94f1-04dee88eeb03','volkswagen-amarok','Volkswagen Amarok','','Amarok resalta con su gran dise&ntilde;o, de construcci&oacute;n robusta, con llantas que llegan hasta 18'''', con nuevos faros antiniebla, doble parrilla frontal y terminaciones en cromo que dan un look que destaca tanto en zonas urbanas como si la usas para el trabajo.',0,1,1,1,1,1,NULL,NULL,0.0,NULL,'2021-07-01 18:16:37.053985000','2021-08-20 18:15:10',NULL,'4e419e2f-a4cc-41b4-bf50-87309be82c77',NULL,'9f6a763a-716c-44c0-a8e3-588a616af14f','Independiente del contexto no pierdas estilo',5,'Asfalto, tierra, campo o ciudad. No importa donde estés, la experiencia de confort que otorga la Nueva Amarok Diesel es igual en cualquier tipo de superficie. Ya que combina espacio, estabilidad con su tracción 4MOTION y tecnología , lo que da como resultado una pick up con una comodidad a todo terreno.  ','8c67b10d-08b2-4fdd-bbd3-f40685837039','ACTIVE'),
	 ('30572887-37f4-4b35-9e7b-48bbaa30b289','volkswagen-virtus','Volkswagen Virtus','','En una perfecta combinaci&oacute;n de tecnolog&iacute;a, innovaci&oacute;n y tradici&oacute;n',0,1,1,1,1,1,NULL,NULL,96.0,NULL,'2021-07-01 17:22:33.976908000','2021-08-20 18:01:35',NULL,'843c4ea4-eb41-4a85-b776-078d436cf29c','<ul>
