	 ('51700c93-d4a3-4895-806e-1ebee0fd4cc6','¿Cómo funciona?','<p>Por una cuota mensual, te ofrecemos un servicio integral de movilidad que te permite acceder a los veh&iacute;culos que tu empresa necesita. El servicio de Lestido Renting incluye todo lo que requieres y m&aacute;s.</p>
<div data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">
<h4 data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">Servicios incluidos:</h4>
<ul data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">
<li data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">Patente</li>
<li data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">Seguro</li>
<li data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">Mantenimiento mec&aacute;nico preventivo completo</li>
<li data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">Mantenimiento correctivo</li>
<li data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">Cambio de neum&aacute;ticos por desgaste de uso</li>
<li data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">Asistencia mec&aacute;nica 24 horas, 365 d&iacute;as al a&ntilde;o en todo el territorio nacional</li>
<li data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">Autom&oacute;vil de reemplazo</li>
</ul>
</div>','',1,'como-funciona','2021-06-22 16:42:16.628027000','2021-08-10 19:16:55',NULL,'1b24b312-9234-4982-9f84-077a0772cb13',NULL),
	 ('b86324bc-e71a-4e1d-b23c-8755526cf902','Beneficios de Lestido Renting','<h4>Por una cuota fija mensual te beneficias de:<br /><br /></h4>
<ul data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">
<li data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">Obtener los veh&iacute;culos sin realizar un desembolso inicial de dinero</li>
<li data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">Imagen, seguridad y confort. Disfrutar siempre de veh&iacute;culos modernos, con lo &uacute;ltimo en seguridad y tecnolog&iacute;a</li>
<li data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">La tarifa es fija por lo que podr&aacute;s planificar mejor los gastos</li>
<li data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">Costos fijos y de mantenimiento incluidos</li>
<li data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">No perder dinero y tiempo por no disponer de movilidad</li>
<li data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">Personal libre para dedicarse a la actividad propia de tu empresa y no a la gesti&oacute;n de flota</li>
<li data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">Despreocuparte de la depreciaci&oacute;n de tus veh&iacute;culos. Cuando pase el periodo de alquiler, decid&iacute;s si cambias, devolv&eacute;s o te los qued&aacute;s</li>
<li data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">Pagar menos IRAE, ya que nuestras facturas son 100% deducibles</li>
<li data-v-3dd2e005="\\&quot;\\&quot;" data-v-005bfc5a="\\&quot;\\&quot;">Disminuir el IP, ya que el tener flota propia implica un aumento en la tributaci&oacute;n de este impuesto</li>
</ul>','',1,'beneficios-lestido-renting','2021-06-22 15:43:28.814525000','2021-08-10 19:26:52',NULL,'03fcffa7-0915-4b41-8bfe-02219ab62c06',NULL),
	 ('d184fa8e-09c0-4895-9e67-8c151524131f','Empresa','<p>En funci&oacute;n de tu estilo de vida o el tipo de negocio que dirijas, tendr&aacute;s que cubrir distintas necesidades de movilidad, tanto de personas como de transporte de productos u otros servicios. Para ello, es fundamental contar con veh&iacute;culos de calidad y un proveedor que ofrezca soluciones y servicios que te garanticen seguridad y fiabilidad.</p>
<p align="JUSTIFY">&nbsp;</p>','<p>As&iacute; nace&nbsp;<strong>Lestido Renting,</strong>&nbsp;reafirmando los valores de compromiso, trabajo en equipo, profesionalismo, orientaci&oacute;n a la calidad e integridad, de Julio C&eacute;sar Lestido S.A., una de las empresas m&aacute;s importantes del pa&iacute;s, presente desde hace m&aacute;s de 70 a&ntilde;os y l&iacute;der del rubro automotriz en Uruguay.</p>',0,'empresa','2021-06-22 18:40:41.529455000','2021-07-09 15:37:25',NULL,'e8c23a3f-5f61-400b-83d2-df9eb29a682f',''),
	 ('eda8ef35-8f28-4087-806a-da7cc2afb472','Política de privacidad','','<p><span style="font-family: Helvetica, serif;">Al marcar la opci&oacute;n &ldquo;Acepto&rdquo; usted est&aacute; otorgando su consentimiento para el tratamiento de</span><span style="font-family: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">sus datos personales por parte de Lestido Movilidad S.A.S. (&ldquo;Lestido Renting&rdquo;) conforme a los t&eacute;rminos y condiciones de</span><span style="font-family: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">la</span><span style="font-family: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">presente</span><span style="font-family: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">pol&iacute;tica</span><span style="font-family: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">de</span><span style="font-family: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">privacidad.</span></p>
