: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">aqu&iacute;</span><span style="font-family: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">se</span><span style="font-family: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">detalla,</span><span style="font-family: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">conforme</span><span style="font-family: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">a</span><span style="font-family: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">la </span><span style="font-family: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">normativa</span><span style="font-family: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">vigente (ley</span><span style="font-family: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">18.331</span><span style="font-family: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">y</span><span style="font-family: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">decreto</span><span style="font-family: Helvetica, serif;"> </span><span style="font-family: Helvetica, serif;">414/09).</span></p>
