INSERT INTO heroku_e9c2cc23efa9974.car_category (id,slug,name,similary,detail,featured,propAirConditioner,propPassengers,propDoors,propLuggages,propHandLuggages,propTransmission,propFuel,price,conditions,createdAt,updatedAt,deletedAt,imageId,featuredDetail,imageMainId,detailTitle,`order`,intro,dataSheetId,status) VALUES
	 ('7c2918d7-69e2-4c1e-b86c-a9452240ad69','volkswagen-t-cross','Volkswagen T-Cross','','El Nuevo T-Cross fue creado para brindarte toda la&nbsp;<strong>conectividad, versatilidad y seguridad</strong>&nbsp;que necesit&aacute;s.<br /><br />Marca tendencia con el dise&ntilde;o del Nuevo T-Cross: La l&iacute;nea continua desde el cap&oacute; hasta las luces traseras y la carrocer&iacute;a angular caracterizan el trazado progresivo de las l&iacute;neas y confieren a este SUV un aspecto din&aacute;mico y transgresor.',0,1,1,1,1,1,NULL,NULL,0.0,NULL,'2021-07-01 17:32:47.209261000','2021-08-20 18:04:00',NULL,'528d75b8-773c-40fb-a905-ffd9406ce0f6',NULL,'8729d900-e447-4a3f-a8ee-5c5ed9a6bc91','El nuevo SUV de Volkswagen',10,'El nuevo T-Cross entrega una seguridad que destaca por sobre sus competidores, con una motorización de 1.6 MSI y 110 HP equipado de serie con 6 Airbags y Control electrónico de estabilización que refuerzan la seguridad que solo un T-Cross puede dar.',NULL,'ACTIVE'),
	 ('901d8dd0-7365-47fa-ad19-dc02a718873f','volkswagen-saveiro-cabina-doble','Volkswagen Saveiro cabina doble','','Mezcla de rendimiento y performance. Saveiro est&aacute; equipada con un motor din&aacute;mico de 1.6L que ofrece un torque m&aacute;ximo a bajas revoluciones, mayor econom&iacute;a de combustible y respuestas r&aacute;pidas. Es la uni&oacute;n perfecta de un veh&iacute;culo capaz de aguantar una carga pesada y a la vez perfectamente c&oacute;moda para el d&iacute;a a d&iacute;a',0,1,1,1,1,1,NULL,NULL,290.0,NULL,'2021-07-01 18:04:39.711395000','2021-08-20 18:13:33',NULL,'e702f35b-6247-4084-a9eb-5fd88d0aa4f7',NULL,'d0af4940-974f-428a-b08f-890516d055b3','Saveiro supera todas las expectativas.',7,'La Nueva Saveiro supera todas las expectativas, con un diseño único, soporta todas las exigencias del trabajo. Además, es la unión perfecta de un vehículo capaz de aguantar un servicio pesado y perfectamente cómodo para el descanso y la aventura.','5e237e95-8a2c-43c2-837b-de1e123d5773','ACTIVE'),
	 ('964df9ed-dd66-424c-be9e-9590c3d33237','audi-q2','Audi Q2','','',0,1,1,1,1,1,NULL,NULL,0.0,NULL,'2021-07-01 18:35:37.320661000','2021-07-26 15:48:08',NULL,'9f811d52-0a02-48cd-9178-f5a6202d21f2',NULL,'a2b554f4-3c22-4bf1-b3c3-ddd4db6ac60c','Multifacético',19,'A primera vista, impresiona. Pero cuando empiezas a fijarte en sus detalles descubres que el Audi Q2 es puro músculo. Carrocería ancha, rasgos angulosos… desprende energía y confianza en sí mismo.','051557ca-6c6d-4866-b7fd-87c9bf7f1187','ACTIVE'),
	 ('a4404680-ca7d-46c4-95c8-5f708a757201','volkswagen-polo','Volkswagen Polo','','El nuevo Volkswagen Polo 2021 es el &uacute;nico de su categor&iacute;a que ha logrado la m&aacute;xima puntuaci&oacute;n del Latin NCAP con cinco estrellas, convirti&eacute;ndose en el auto m&aacute;s seguro de su segmento. Adem&aacute;s, cuenta con lo mejor de la tecnolog&iacute;a europea como solo Volkswagen puede ofrecer. Descubre el Nuevo Polo.',0,1,1,1,1,1,NULL,NULL,0.0,NULL,'2021-07-01 17:26:17.845201000','2021-08-10 21:01:39',NULL,'6c82ed59-1096-466f-a470-fe7ad5115c41',NULL,'71660769-82ff-4b28-b709-9caf3197e9ee','Performance de un auténtico GTS',12,'El Nuevo Polo GTS viene con diversos equipamientos de seguridad y confort que no sólo van a impresionarte, te van a dar ganas de no bajarte nunca.','d3cd103a-09a0-4891-a794-a968c75c6434','ACTIVE'),
	 ('c35e4c49-b03e-4f51-ae66-8750762d9180','audi-q7','Audi Q7','','<p class="nm-intro__copy audi-copy-m">El nuevo Audi Q7 es el SUV m&aacute;s imponente de su categor&iacute;a. Con un dise&ntilde;o renovado y nuevos motores con tecnolog&iacute;a eficiente Mild hybrid de serie. Con una amplia gama de sistemas de asistencia a la conducci&oacute;n. M&aacute;s din&aacute;mico gracias al sistema anti-balanceo activo, la suspensi&oacute;n neum&aacute;tica y la tracci&oacute;n integral quattro. Y con una oferta de infotainment premium, con amplios displays que ofrecen feedback h&aacute;ptico y ac&uacute;stico. Sin duda, el Audi Q7 es superior en todo.</p>',0,1,1,1,1,1,NULL,NULL,0.0,NULL,'2021-07-01 18:43:39.239143000','2021-07-02 18:58:45',NULL,'a6f3b52e-c569-445c-9eb7-8032e7e86aa3',NULL,'9032748d-e41f-4f6c-96bc-449c9cd554ea','Superior en todo',16,'El nuevo Audi Q7 muestra un diseño renovado que impone desde el primer vistazo gracias a su amplia parrilla Audi Singleframe. Otro elemento que destaca notablemente son sus faros, con un nuevo contorno y una firma lumínica que realza la anchura del modelo.',NULL,'INACTIVE'),
	 ('cdaecbab-d409-40dd-ad07-3b5ed2130ce3','volkswagen-gol-sedn','Volkswagen Gol Sedán','','Con el gol sed&aacute;n podr&aacute;s encontrar diversi&oacute;n para toda tu familia, no solo en la ciudad, sino tambi&eacute;n fuera de ella y con todo lo que necesitan, gracias a su capacidad de ba&uacute;l de 480 litros.',0,1,1,1,1,1,'manual','gasoline',54.0,NULL,'2021-06-22 15:20:08.430053000','2021-08-20 18:00:25',NULL,'990f14b6-a1f4-497b-b0ba-11d0e78d3883',NULL,'97b3ffdc-2277-48c2-8b50-3d31f359e1cf','Más espacio interior, más espacio de carga.',14,'Voyage viene renovado con un diseño sofisticado y a la vanguardia. Ahora todos pueden marcar tendencia al manejarlo.
